local function unicode_to_utf8(code)
  local t, h = {}, 128
  while code >= h do
    t[#t + 1] = 128 + code % 64
    code = math.floor(code / 64)
    h = h > 32 and 32 or h / 2
  end
  t[#t + 1] = 256 - 2 * h + code
  return string.char(unpack(t)):reverse()
end

setmetatable(fa_icon, {
  __call = function(t, v)
    if (type(v) == 'string') then
      return t[v:upper()] or '?'
    elseif (type(v) == 'number' and v >= MIN_ICON and v <= MAX_ICON) then
      return unicode_to_utf8(v)
    end
    return '?'
  end,

  __index = {
    min_range = MIN_ICON,
    max_range = MAX_ICON,
    get_font_data_base85 = function(type)
      local list = {
        ['regular'] = fa_regular_compressed_data_base85,
        ['solid'] = fa_solid_compressed_data_base85,
      }
      if not type or not list[type] then return list['regular'] end
      return list[type]
    end
  }
})

return fa_icon
